import { Link } from 'react-router-dom'

const startPage = () => {
  return (
    <div>
      <Link to='/instructions'>Instructions</Link>
      <Link to='/guidedAnnotation'>Guided Annotation</Link>
      <Link to='/annotation'>Annotation</Link>
    </div>
  )
}

export default startPage
